import React from 'react';
import './Caderno.css';
import caderno from '../img/caderno.png'

const Caderno = () => {
    return (
        <div className='Title'>
      <h1>Caderno de atividades</h1>
      <img src={caderno} className="caderno" alt="foto2" />
      </div>
    
    );
  };
  
  export default Caderno;
